import React from 'react'
import {withStyles} from "@material-ui/styles";


const styles={
root:{
  height:"32px",
  background:"grey",
  padding:"0px 16px"
}
}

function Chip (props) {
  const {classes}=props;
  return(
    <div className={classes.root}>
      Chip1
    </div>
  )
}

export default withStyles(styles)(Chip);
